import axios from "axios";
import React, { useState } from "react";
import { useMediaQuery } from "react-responsive";

const CaloriesOverview = (date, profile) => {
    const isTabletOrMobile = useMediaQuery({ query : '(max-width: 1224px' })

    const [burnedCalories, setBurnedCalories] = useState(1000)
    const [takenCalories, setTakenCalories] = useState(500)
    const [dayData, setDayDate] = useState(null)

    const getDayData = (date, profile) => {
        axios.get("mocks/dayData.json").then((res) => {
            console.log(res.data)
        })
    }
    return(
        <div>
            {isTabletOrMobile ? (
                <div>
                    <p>Verbrannte Kalorien</p>
                    <p>Konsumierte Kalorien</p>
                    <p>Kaloriendefizit</p>
                </div>
            ) : (
                <div>
                    <p>Verbrannte Kalorien</p>
                    <p>Konsumierte Kalorien</p>
                    <p>Kaloriendefizit</p>
                </div>
            )}
        </div>
    )
}

export default CaloriesOverview;
